import React from 'react';
import './Contact.css';

function Contact(props) {
    const listItems = props.contacts.map((c) =>
        <p><a href={c.URL}>{c.Platform}</a></p>
    );

    // add pfp and description of self

    return (
        <div class="contact">
            <div class="contact__links">
                {listItems}
            </div>
            <div class="contact__profile">
                <div className="contact__img">
                    <img alt="cow" src="https://cdn.britannica.com/55/174255-050-526314B6/brown-Guernsey-cow.jpg" />
                </div>
                <div class="contact__text">
                    <h3>Fan Guo</h3>
                    <p>product-focused web engineer and engineering manager</p>
                </div>
            </div>
        </div>
    );
}

export default Contact;
